import styled from "styled-components";

const StrongContainer = styled.div`
width: 23.2rem;
height: 14.5rem;
margin: 0 5rem;
margin-top: 1rem;
text-align: center;
line-height: 14.8rem;
color: #bfbfbf;
font-size: 1.4rem;
`;

const StrongItem = styled.div`
width: 23.2rem;
height: 2.5rem;
margin-bottom: 0.5rem;
color: black;
font-size: 1.4rem;
line-height: 2.5rem;

&:nth-child(5) {
    margin-bottom: 0;
}
`;
const StrongCircle = styled.div`
    width: 2.5rem;
    height: 2.5rem;
    border-radius: 999rem;
`;

function StrongItems () {
    return (
        <StrongItem>
            <StrongCircle />
            100
        </StrongItem>
    )
}


function StrongTest () {
    return (
        <StrongContainer>
            <StrongItems></StrongItems>
            <StrongItems></StrongItems>
            <StrongItems></StrongItems>
            <StrongItems></StrongItems>
            <StrongItems></StrongItems>
        </StrongContainer>
    )
}



export default StrongTest;
